DROP TABLE IF EXISTS `iot_device`;
CREATE TABLE `iot_device` (
  `id` varchar(32) NOT NULL,
  `deviceType` varchar(32) DEFAULT NULL COMMENT '设备类型',
  `classifyId` varchar(32) DEFAULT NULL COMMENT '设备分类',
  `productId` varchar(32) DEFAULT NULL COMMENT '所属产品',
  `parentId` varchar(32) DEFAULT NULL COMMENT '上级设备ID',
  `protocolId` varchar(32) DEFAULT NULL COMMENT '设备协议',
  `protocolCode` varchar(32) DEFAULT NULL COMMENT '协议标识',
  `deviceNo` varchar(32) DEFAULT NULL COMMENT '设备通讯号',
  `meterNo` varchar(32) DEFAULT NULL COMMENT '设备编号（铭牌号）',
  `lat` varchar(32) DEFAULT NULL COMMENT '纬度',
  `lng` varchar(32) DEFAULT NULL COMMENT '经度',
  `imei` varchar(32) DEFAULT NULL COMMENT 'IMEI',
  `iccid` varchar(32) DEFAULT NULL COMMENT 'ICCID',
  `iotPlatformId` varchar(255) DEFAULT NULL COMMENT '第三方IOT平台设备id',
  `abnormal` tinyint(8) DEFAULT 0 COMMENT '设备状态',
  `online` tinyint(1) DEFAULT 0 COMMENT '在线状态',
  `lastConnectionTime` bigint(64) DEFAULT NULL COMMENT '最新通讯连接时间',
  `createdBy` varchar(32) DEFAULT NULL COMMENT '创建人',
  `createdAt` bigint(64) DEFAULT NULL COMMENT '创建时间',
  `updatedBy` varchar(32) DEFAULT NULL COMMENT '修改人',
  `updatedAt` bigint(64) DEFAULT NULL COMMENT '修改时间',
  `delFlag` tinyint(1) DEFAULT NULL COMMENT '删除标记',
  `valveState` int(32) DEFAULT NULL COMMENT '阀门/开关状态',
  `abnormalTime` bigint(64) DEFAULT NULL COMMENT '异常时间',
  `lastDataTime` bigint(64) DEFAULT NULL COMMENT '最新数据时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_DEVICE_DEVICE_NO` (`productId`,`deviceNo`),
  UNIQUE KEY `IDX_DEVICE_DEVICE_PROTOCOL` (`protocolCode`,`deviceNo`),
  KEY `IDX_DEVICE_METERNO` (`meterNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='设备信息表';

